import {
    Container,
    SimpleGrid,
    Image,
    Flex,
    Heading,
    Text,
    Stack,
    StackDivider,
    Box,
    Icon,
    Avatar,
    useColorModeValue,
  } from '@chakra-ui/react';
  import {
    IoAnalyticsSharp,
    IoLogoBitcoin,
    IoSearchSharp,
  } from 'react-icons/io5';
  import { ReactElement } from 'react';
  
  const Testimonial = ({ children }: { children: ReactNode }) => {
    return <Box>{children}</Box>;
  };
  
  const TestimonialContent = ({ children }: { children: ReactNode }) => {
    return (
      <Stack
        bg={useColorModeValue('white', 'gray.800')}
        boxShadow={'lg'}
        p={8}
        rounded={'xl'}
        align={'center'}
        pos={'relative'}
        _after={{
          content: `""`,
          w: 0,
          h: 0,
          borderLeft: 'solid transparent',
          borderLeftWidth: 16,
          borderRight: 'solid transparent',
          borderRightWidth: 16,
          borderTop: 'solid',
          borderTopWidth: 16,
          borderTopColor: useColorModeValue('white', 'gray.800'),
          pos: 'absolute',
          bottom: '-16px',
          left: '50%',
          transform: 'translateX(-50%)',
        }}>
        {children}
      </Stack>
    );
  };
  
  const TestimonialHeading = ({ children }: { children: ReactNode }) => {
    return (
      <Heading as={'h3'} fontSize={'xl'}>
        {children}
      </Heading>
    );
  };
  
  const TestimonialText = ({ children }: { children: ReactNode }) => {
    return (
      <Text
        textAlign={'center'}
        color={useColorModeValue('gray.600', 'gray.400')}
        fontSize={'sm'}>
        {children}
      </Text>
    );
  };
  
  const TestimonialAvatar = ({
    src,
    name,
    title,
  }: {
    src: string;
    name: string;
    title: string;
  }) => {
    return (
      <Flex align={'center'} mt={8} direction={'column'}>
        <Avatar src={src} alt={name} mb={2} />
        <Stack spacing={-1} align={'center'}>
          <Text fontWeight={600}>{name}</Text>
          <Text fontSize={'sm'} color={useColorModeValue('gray.600', 'gray.400')}>
            {title}
          </Text>
        </Stack>
      </Flex>
    );
  };
  export default function Description_1() {
    return (

      <Box bg={useColorModeValue('gray.100', 'gray.700')}>
      <Container maxW={'7xl'} py={16} as={Stack} spacing={0}>
        <Stack spacing={0} align={'center'}>
          <Heading>Our Clients Speak</Heading>
          <Text>We have been working with clients around the world</Text>
        </Stack>
        <Stack
        bg='url(images/bg_1.png)'
        spacing={0}
        align={'center'}
        >
       <Flex
       flexDir="row"
       >
          <Flex
          >
            <Image
                rounded={'md'}
                alt={'feature image'}
                src={
                  'images/boxes_man.png'
                }
                objectFit={'cover'}
              />
          </Flex>
            <Flex
            pt={100}
            w={600}
            h={600}
            ml={250}
            bg="rgba(0,0,0,0.3)"
            >
            <Box>
                <Box
                paddingTop={8}
                pl={50}
                pr={300}
                >
                  <Text
                  position="relative"
                  fontSize={40}
                  color={'white'}
                  fontFamily="Montserrat"
                  fontWeight={600}
                  >
                    Helps you manage your inventory and business easily
                  </Text>

                </Box>
                <Box
                pl={50}
                pt={100}
                >
                    <Text
                    fontSize={25}
                    color={'white'}
                    fontFamily="Montserrat"
                    fontWeight={400}
                    >
                      Run a more efficient business with the best inventory management system
                    </Text>
                </Box>
            </Box>
            </Flex>
        </Flex>
        
    </Stack>
      </Container>
    </Box>
    
      
    );
  }
